import { inspect } from '@devvit/shared-types/inspect.js';
/** Enqueues logs. */
export class QueueConsole {
    constructor() {
        this.logs = [];
    }
    debug(...args) {
        this.logs.push({ method: 'debug', args: args.map((arg) => inspect(arg)) });
    }
    error(...args) {
        this.logs.push({ method: 'error', args: args.map((arg) => inspect(arg)) });
    }
    info(...args) {
        this.logs.push({ method: 'info', args: args.map((arg) => inspect(arg)) });
    }
    log(...args) {
        this.logs.push({ method: 'log', args: args.map((arg) => inspect(arg)) });
    }
    trace(...args) {
        this.logs.push({ method: 'trace', args: args.map((arg) => inspect(arg)) });
    }
    warn(...args) {
        this.logs.push({ method: 'warn', args: args.map((arg) => inspect(arg)) });
    }
}
